function genLeft(par) {
    var c = Math.floor(Math.random() * Number(par));
    if (leftPosArray.includes(c)) {
        genLeft(par);
    }
    else {
        //c =   Math.floor( Math.random() * Number( par ) );
        leftPosArray.push(c);
    }
    return c;
}
function genTop(par) {
    var c = Math.floor(Math.random() * Number(par));
    if (topPosArray.includes(c)) {
        genLeft(par);
    }
    else {
        topPosArray.push(c);
    }
    return c;
}

